import React from "react";
import { useEffect, useState, createElement } from "react";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";
import { Switch, Route, Link } from "react-router-dom";
import axios from "axios";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

const p = (a) => {
  console.log(a);
};
const About = (props) => {
  const [frontEndItem, setFrontEndItem] = useState([
    {
      title: "Create-React-App",
      about: "React",
      link: "React",
    },
    {
      title: "Bootstrap",
      about: "The world’s most popular front-end open source toolkit.",
      link: "https://getbootstrap.com/",
    },
  ]);
  const [backEndItem, setBackEndItem] = useState([
    {
      title: "Mongo DB",
      about: "A non-relational database that plays well with json. ",
      link: "",
    },
    {
      title: "Mongoose",
      about: "A database helper",
      link: "",
    },
  ]);

  return (
    <>
      <div className="box">
        <Link to={"/"}>
          <button className="btn btn-secondary">
            <big>Home</big>
          </button>
        </Link>
        <h2>About This Project</h2>
      </div>

      <table class="table">
        <thead>
          <tr>
     
            <th scope="col">First</th>
            <th scope="col">Last</th>
            <th scope="col">Handle</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>
    </>
  );
};

export default About;
